import React,{Component} from 'react';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state={
      abc:[]
    }
  }
  componentDidMount(){
    fetch('/data')
    .then(res => res.json())
    .then(abc=>this.setState({abc},()=> console.log("adasd",abc)));
  }
  render(){
  return (
      <div>
        <div class="form-group">
          <div class="row">
            <div class="col">
              <label for="">Name</label>
              <input type="text" class="form-control" id="name"> </input>
            </div>
            <div class="col"> </div>
          </div>
        </div>
      </div>
  );
}}

export default App;
